import React from "react";
import Card from "./Card";
import { useEffect, useState } from "react";

const Cards = ({ posts }) => {
  return (
    <div className="grid sm:flex sm:flex-col grid-cols-1 md:grid-cols-2 lg:grid-cols-3  justify-center items-center bg-gray-100 px-14 py-16">
      {posts?.map((post) => (
        <Card key={post.id} post={post} />
      ))}
      <Card />
    </div>
  );
};

export default Cards;
